    false,nt"url": null,nt"notes": "A survey of the California Clapper Rail
    (Rallus longirostris obsoletus) was  conducted from December 1978 through July 1979
    in the San Francisco, Monterey and Morro bay areas. Several areas of high abundance
    were censused as well as some localities in the periphery of the Clapper Rail's
    range. Nonbreeding season densities of Clapper Rails in South San Francisco Bay
    appeared to be higher than those found in the early 1970's. In Elkhorn Slough, Monterey
    County, a population-of at least two pairs produced a minimum of two young. In Suisun
    Marsh, Solano County, an estimated population of 25 rails was present through the
    breeding season. No Clapper Rails were found at Morro Bay, San Luis Obispo County.",nt"owner_org":
